import React, { useEffect, useState } from 'react';
import './wishlist.css';
import axios from 'axios'; 

const Wishlist = () => {

    const [storedData, setStoredData] = useState([]);

    useEffect(() => {
        setStoredData(JSON.parse(sessionStorage.getItem('wishlistarray')));
    }, [])

    const cancelItemWishlist = (index) => {
        const newArray = storedData.filter((item, idx) => idx !== index);
        setStoredData(newArray);
        sessionStorage.setItem('wishlistarray', JSON.stringify(newArray));
    }

    const thereIsProducts = () => {
        if(storedData === null){
            return false; 
        }
        return storedData.length > 0; 
    }

    // const quotationRequestSent = ({popupRef}) => {
    //     return (
    //         <div ref={popupRef}>
    //             <div className='quotes-request-bg'>
    //                 <p>Quotation Request Sent!</p>
    //                 <p>Kindly allow 1-5 working days.</p>
    //                 <button onClick={closeNotifyPopup}>Close</button>
    //             </div>
    //         </div>
    //     )
    // }

    // const closeNotifyPopup = () => {
    //     setIsPopupOpen(!isPopupOpen);
    // }

    // const [isPopupOpen, setIsPopupOpen] = useState(false);
    // const popupRef = useRef(null);

    // const handleClickOutside = (event) => {
    //     if (popupRef.current && !popupRef.current.contains(event.target)) {
    //         setIsPopupOpen(false);
    //     }
    // };

    // useEffect(() => {
    //     if (isPopupOpen) {
    //         document.addEventListener('mousedown', handleClickOutside);
    //     } else {
    //         document.removeEventListener('mousedown', handleClickOutside);
    //     }

    //     return () => {
    //         document.removeEventListener('mousedown', handleClickOutside);
    //     };
    // }, [isPopupOpen]);


    const removeAllItemsWishlist = () => {
        sessionStorage.removeItem('wishlistarray');
        setStoredData(JSON.parse(sessionStorage.getItem('wishlistarray'))); 
    }

    const checkStorePopup = async (key) => {
        // let arrayOfProductids = [];
        // const storedList = JSON.parse(sessionStorage.getItem(key));
        // //check pdt list productID combination is identical? 
        // storedList.forEach(element => {
        //     arrayOfProductids.push(element.productID); 
        // });
        // console.log(arrayOfProductids); 

        try {
            const response = await axios.post('http://localhost:5000/api/quote', {
                username,
                email,
                password
            });
            console.log('Data submitted:', response.data);
            navigate('/');
        } catch (error) {
            if (error.response && error.response.status === 400) {
                console.error('Error:', error.response.data);
                setError('email', { type: 'manual', message: error.response.data });
            } else {
                console.error('Error posting data:', error.response ? error.response.data : error.message);
            }
        }

    }

    return (
        <div>
            <h1>WISHLIST</h1>
            <button onClick={removeAllItemsWishlist} className='btn btn-danger' style={{ float: 'right' }}>Remove All</button>
            <div className='white-bg'>
                <table className='outlined-table'>
                    <thead>
                        <tr>
                            <th>Product</th>
                            <th>Product ID</th>
                            <th>Product Name</th>
                            <th>Cancel</th>
                        </tr>
                    </thead>
                    {(storedData) ? (
                        storedData.map((product, index) => (
                            <tbody key={index}>
                                <tr>
                                    <td><img src={product.imageURL} alt='' style={{ width: '100px', height: 'auto' }} /></td>
                                    <td>{product.productID}</td>
                                    <td>{product.productName}</td>
                                    <td className='cancel-product-wishlist' onClick={() => cancelItemWishlist(index)}>X</td>
                                </tr>
                            </tbody>
                        ))
                    ) : (
                        <p>No items in Wishlist.</p> // storedData === null 
                    )}
                </table>
            </div>

            {thereIsProducts() && (
                <div style={{ display: 'flex', justifyContent: 'center', paddingTop: '10px' }}>
                    <button onClick={checkStorePopup('wishlistarray')} className='btn btn-warning' style={{ width: '95%' }}>Request for Price Quotations</button>
                </div>
            )}

        </div>
    )
}

export default Wishlist;
